CREATE TABLE clientes  (
    clie_codigo numeric(7,0),
    clie_nome character varying(60),
    clie_cida_codigo_res numeric(5,0),
    clie_cidade character varying(50),
    clie_razaosocial character varying(60),
    clie_endres character varying(40),
    clie_endcom character varying(50),
    clie_rgie character varying(20),
    clie_cnpjcpf character varying(14),
    clie_repr_codigo numeric(4,0),
    clie_fpgt_codigo character varying(3),
    clie_cepres character varying(8),
    clie_cepcom character varying(8),
    clie_bairrores character varying(30),
    clie_bairrocom character varying(30),
    clie_obs character varying(200)
);


